import React from "react";
import "./AboutMe.css";
import { FaGithub, FaLinkedin } from "react-icons/fa"; 

const AboutMe = () => {
  const teamMembers = [
    {
      name: "Mahi Thakkar",
      github: "https://github.com/mahithakkar",
      linkedin: "https://www.linkedin.com/in/mahi-thakkar/",
      contribution: "Briefly summarize how you contributed to the project towards the end."
    },
    {
      name: "Savya Miriyala",
      github: "https://github.com/msavya",
      linkedin: "https://www.linkedin.com/in/savya-miriyala/",
      contribution: "Briefly summarize how you contributed to the project towards the end."
    },
    {
      name: "Sophia Jin",
      github: "https://github.com/sophiajinn",
      linkedin: "https://www.linkedin.com/in/sophia-jin/",
      contribution: "Briefly summarize how you contributed to the project towards the end."
    }
  ];

  return (
    <div className="about-container">
      <h1 className="title">About Us</h1>
      <div className="team-grid">
        {teamMembers.map((member, index) => (
          <div key={index} className="team-card">
            <h3>{member.name}</h3>
            <div className="icons">
              <a href={member.github} target="_blank" rel="noopener noreferrer">
                <FaGithub className="icon github" />
              </a>
              <a href={member.linkedin} target="_blank" rel="noopener noreferrer">
                <FaLinkedin className="icon linkedin" />
              </a>
            </div>
            <p className="contribution">{member.contribution}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AboutMe;
